public class InterfaceDefinitionNotFoundException extends Exception {

	/**
	 * 
	 */
	private static final long serialVersionUID = 1L;

	public InterfaceDefinitionNotFoundException() {
		super();
		// TODO Auto-generated constructor stub
	}

	public InterfaceDefinitionNotFoundException(String message, Throwable cause, boolean enableSuppression,
			boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

	public InterfaceDefinitionNotFoundException(String message, Throwable cause) {
		super(message, cause);
	}

	public InterfaceDefinitionNotFoundException(String message) {
		super(message);
	}

	public InterfaceDefinitionNotFoundException(Throwable cause) {
		super(cause);
	}
	
	

}
